OpcUa_StatusCode UnsignedRationalNumbers::setUnsignedRationalNumbers(OpcUa_Variant &variant, OpcUa_Boolean bDetach)
{
    clear();

    OpcUa_StatusCode ret = OpcUa_BadTypeMismatch;
    if (variant.Datatype == OpcUaType_ExtensionObject &&
        variant.ArrayType == OpcUa_VariantArrayType_Array)
    {
        ret = OpcUa_Good;
        m_noOfElements = variant.Value.Array.Length >= 0 ? variant.Value.Array.Length : 0;
        if (m_noOfElements > 0 && variant.Value.Array.Value.ExtensionObjectArray != OpcUa_Null)
        {
            m_data = (OpcUaClassBnm_UnsignedRationalNumber*)OpcUa_Alloc(m_noOfElements * sizeof(OpcUaClassBnm_UnsignedRationalNumber));

            OpcUa_UInt32 i = 0;
            for (i = 0; i < m_noOfElements; i++)
            {
                OpcUaClassBnm_UnsignedRationalNumber_Initialize(&m_data[i]);

                OpcUaClassBnm_UnsignedRationalNumber *pValue = OPCUACLASSBNM_EXTENSIONOBJECT_GET_ENCODEABLE(UnsignedRationalNumber, &variant.Value.Array.Value.ExtensionObjectArray[i]);
                if (pValue)
                {
                    if (bDetach != OpcUa_False)
                    {
                        m_data[i] = *pValue;
                        OpcUaClassBnm_UnsignedRationalNumber_Initialize(pValue);
                    }
                    else
                    {
                        OpcUaClassBnm_UnsignedRationalNumber_CopyTo(pValue, &m_data[i]);
                    }
                }
                else
                {
                    ret = OpcUa_BadTypeMismatch;
                    break;
                }
            }
            if (OpcUa_IsNotGood(ret))
            {
                for (OpcUa_UInt32 j = 0; j < i; j++)
                {
                    OpcUaClassBnm_UnsignedRationalNumber_Clear(&m_data[j]);
                }
                OpcUa_Free(m_data);
                m_data = (OpcUaClassBnm_UnsignedRationalNumber*)OpcUa_Null;
                m_noOfElements = 0;
            }
        }
        else
        {
            m_noOfElements = 0;
        }
    }
    return ret;
}

